        public string GetQuanPin(string gbCode)
        {
            string strPY = string.Empty;
            string strHz = string.Empty;
            int number;

            //È¥³ı×Ö·û´®ÖĞµÄ±êµã·ûºÅ
            string separatorsStr = ",£¬.¡£;£»:£º'¡®¡°£¨£©¢ñ¢ò¢ó¡¢";
            char[] separators = separatorsStr.ToCharArray();
            string[] str;
            str = gbCode.Split(separators);
            string strCode = str[0];
            for (int i = 1; i < str.Length; i++)
            {
                strCode = strCode + str[i];
            }
            gbCode = strCode;

            for (int i = 0; i < gbCode.Length; i++)
            {
                number = ASC(gbCode.Substring(i, 1));

                if (number > 0 && number < 160)
                {
                    strHz = gbCode.Substring(i, 1);
                    strPY += gbCode.Substring(i, 1);
                }
                else
                {
                    try
                    {
                        strHz = gbCode.Substring(i, 1);
                        if (Pinyin.ContainsKey(strHz))
                        {
                            strPY += Pinyin[strHz].ToString();
                        }
                        else
                        {
                            strPY += "*";
                        }
                    }
                    catch
                    {
                        continue;
                    }
                }

            }
            
            return strPY.ToUpper();
        }

