        private int ASC(String Data) //»ñÈ¡ASCÂë
        {
            byte[] b = System.Text.Encoding.Default.GetBytes(Data);
            int p = 0;

            if (b.Length == 1) //Èç¹ûÎªÓ¢ÎÄ×Ö·ûÖ±½Ó·µ»Ø
                return (int)b[0];
            for (int i = 0; i < b.Length; i += 2)
            {
                p = (int)b[i];
                p = p * 256 + b[i + 1] - 65536;
            }
            return p;
        }

